import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import Services from './pages/Services';
import Portfolio from './pages/Portfolio';
import About from './pages/About';
import OurModel from './pages/OurModel';
import Development from './pages/services/Development';
import ECommerce from './pages/services/ECommerce';
import SaasSolutions from './pages/services/SaasSolutions';
import AIAutomations from './pages/services/AIAutomations';
import ITSupport from './pages/services/ITSupport';
import ITConsulting from './pages/ITConsulting';
import PlaceholderPage from './pages/PlaceholderPage';

function App() {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [isHovering, setIsHovering] = useState(false);

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };

    const handleMouseOver = (e) => {
      const target = e.target;
      if (
        target.tagName === 'A' ||
        target.tagName === 'BUTTON' ||
        target.tagName === 'INPUT' ||
        target.tagName === 'TEXTAREA' ||
        target.getAttribute('role') === 'button' ||
        target.closest('a') ||
        target.closest('button')
      ) {
        setIsHovering(true);
      } else {
        setIsHovering(false);
      }
    };

    window.addEventListener('mousemove', handleMouseMove);
    window.addEventListener('mouseover', handleMouseOver);

    return () => {
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('mouseover', handleMouseOver);
    };
  }, []);

  return (
    <Router>
      {/* Custom cursor glow */}
      <div
        className={`cursor-glow ${isHovering ? 'hovering' : ''}`}
        style={{
          left: `${mousePosition.x}px`,
          top: `${mousePosition.y}px`
        }}
        aria-hidden="true"
      />

      <div className="min-h-screen bg-space-950 text-white smoky-overlay flex flex-col">
        <Navbar />
        <main className="flex-1">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/portfolio" element={<Portfolio />} />
            <Route path="/our-model" element={<OurModel />} />
            <Route path="/services/development" element={<Development />} />
            <Route path="/services/ecommerce" element={<ECommerce />} />
            <Route path="/services/saas-solutions" element={<SaasSolutions />} />
            <Route path="/services/ai-automations" element={<AIAutomations />} />
            <Route path="/services/it-support" element={<ITSupport />} />
            <Route path="/consulting" element={<ITConsulting />} />

            {/* Industries Routes */}
            <Route path="/industries/healthcare" element={<div className="pt-32 text-center"><h1>Healthcare Industry</h1></div>} />
            <Route path="/industries/finance" element={<div className="pt-32 text-center"><h1>Finance & Banking</h1></div>} />
            <Route path="/industries/retail" element={<div className="pt-32 text-center"><h1>Retail & E-Commerce</h1></div>} />
            <Route path="/industries/manufacturing" element={<div className="pt-32 text-center"><h1>Manufacturing</h1></div>} />

            {/* Technology Routes */}
            <Route path="/technology/cloud" element={<PlaceholderPage title="Cloud Infrastructure" category="Technology" />} />
            <Route path="/technology/mobile" element={<PlaceholderPage title="Mobile Development" category="Technology" />} />
            <Route path="/technology/web" element={<PlaceholderPage title="Web Technologies" category="Technology" />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
